import './App.css';

import Login from './components/login';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './views/home';
import Task from './components/task';
import Calend from './components/calendar';

function App() {
  return (
    <Router>
      <div className="App">
        {/* The Login component will always render as the default route */}
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/home" element={<Home />} />
          <Route path="/tasks" element={< Task/>} />
          <Route path="/add-task" element={<Task />} />
          <Route path="/calendar" element={<Calend />} />
          <Route path="/mail" element={<Task />} />
          <Route path="/edit-profile" element={<Task />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
